- input: TEXT,F3XN,,"Northwestern Mutual is a mutual insurance company that maintains
    a corporate office with employees and uses a general agency system of independent
    self-employed general agents to sell its products throughout the United States.  The
    general agents are not employees of The Northwestern Mutual Life Insurance Company,
    but are self-employed independent contractors.  All of Northwestern Mutual's general
    agents are however policyowners of the company and thus are part of the company's
    restricted class.  Contributors to NML FEDPAC whose names appear as the employer
    are the self-employed general agents of Northwestern Mutual.  Pursuant to your
    October 15 2003 conversation with our software vendor Democracy Data & Communications
    attaching this explanatory statement is sufficient clarification for the public
    record."
